import React from 'react';
import { Text, Row, Col } from '../../components/webcomps';
import styled from 'styled-components';

const BodyWrapper = styled(Row)`

  border: 1px solid #ffffff;
  align-items: center;
  width: 256px;
  height: auto;
  margin:auto;
  padding: 4px;
`;
const TextWrapper = styled(Text)`
  font-size: 48px;
  margin:0px;
  font-family: 'Monoton', cursive;
`;
const ImageWrapper = styled.img`
  width: 90px;
  height: auto;
`;
const HeadSymbol = () => (
  <BodyWrapper>
    <ImageWrapper src="https://img.icons8.com/ios/128/ffffff/qr-code-filled.png" />
    <TextWrapper>W</TextWrapper>
    <Col justifyContent="space-between">
      <TextWrapper>HA</TextWrapper>
      <TextWrapper>CK</TextWrapper>
    </Col>
  </BodyWrapper>
);

export default HeadSymbol;
